class Solution(object):
    def numberOfGoodSubarraySplits(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        prefix = [0]
        for num in nums:
            prefix.append(prefix[-1] + num)

        total = prefix[-1]
        if total < 2:
            return 0

        ans = 0
        mod = 10**9 + 7
        for i in range(1, len(prefix)):
            if 1 <= prefix[i] <= total - 1:
                left_ones = prefix[i]
                right_ones = total - left_ones
                if left_ones == 1 or right_ones == 1:
                    ans += 1

        return ans % mod
